      },
      "safeBatchTransferFrom(address,address,uint256[],uint256[],bytes)": {
        "details": "Transfers a batch of tokens",
        "params": {
          "_amounts": "Array of quantities of token to be transferred",
          "_data": "Data",
          "_from": "Address token is being transferred from",
          "_ids": "Array of IDs of tokens being transferred",
          "_to": "Address token is being transferred to"
        }
      },
