  "devdoc": {
    "author": "Kamil Alizai Sadik",
    "kind": "dev",
    "methods": {
      "_buyProceeds(uint256,uint256)": {
        "details": "Calculates proceeds required for a given buy transaction (not including fees)",
        "params": {
          "_amount": "Quantity of the token being transacted",
          "_tokenId": "ID of the token being transacted"
        },
        "returns": {
          "_0": "Proceeds required in the transaction (before fees)"
        }
      },
      "_feeProceeds(uint256)": {
        "details": "Calculates the fee associated with a buy transaction",
        "params": {
          "_proceedsRequired": "The proceeds required for the buy transaction (before addition of fees)"
        },
        "returns": {
          "_0": "Fee associated with transaction"
        }
      },
      "_totalProceeds(uint256,uint256)": {
        "details": "Calculates total transaction proceeds",
        "params": {
          "_amount": "Quantity of the token being transacted",
          "_tokenId": "ID of the token being transacted"
        },
        "returns": {
          "_0": "Total proceeds required in transaction"
        }
      },
      "balanceOf(address,uint256)": {
        "details": "See {IERC1155-balanceOf}. Requirements: - `account` cannot be the zero address."
      },
      "balanceOfBatch(address[],uint256[])": {
        "details": "See {IERC1155-balanceOfBatch}. Requirements: - `accounts` and `ids` must have the same length."
      },
      "buyCreatorToken(uint256,uint256)": {
        "details": "Allows user to buy a given CreatorToken from the platform",
        "params": {
          "_amount": "Quantity of the token being transacted",
          "_tokenId": "ID of the token being transacted"
        }
      },
      "changeAddress(uint256,address)": {
        "details": "Allows token creator to change their address",
        "params": {
          "_newCreatorAddress": "New creator address associated with the token",
          "_tokenId": "ID of the token in question"
        }
      },
      "changeDescription(uint256,string)": {
        "details": "Allows token creator to change the description of their token",
        "params": {
          "_newDescription": "New description associated with the token",
          "_tokenId": "ID of the token in question"
        }
      },
      "changeName(uint256,string)": {
        "details": "Allows token creator to change the name of their token",
        "params": {
          "_newName": "New name associated with the token",
          "_tokenId": "ID of the token in question"
        }
      },
      "changePlatformFee(uint256)": {
        "details": "Allows owner to change platformFee",
        "params": {
          "_newPlatformFee": "New platform fee"
        }
      },
      "changeProfitMargin(uint256)": {
        "details": "Allows owner to change profit_margin",
        "params": {
          "_newProfitMargin": "New profit margin"
        }
      },
      "changeSymbol(uint256,string)": {
        "details": "Allows token creator to change the symbol of their token",
        "params": {
          "_newSymbol": "New symbol associated with the token",
          "_tokenId": "ID of the token in question"
        }
      },
      "changeVerification(uint256,bool)": {
        "details": "Allows owner to verify (or undo verification) of a CreatorToken",
        "params": {
          "_tokenId": "ID of the token in question",
          "_verified": "Verification status of the token in question"
        }
      },
      "createCreatorToken(address,string,string,string)": {
        "details": "Creates a new creator token",
        "params": {
          "_creatorAddress": "Address of the creator of the token",
          "_description": "chosen by the creator of the tokens",
          "_name": "Name chosen by the creator of the token",
          "_symbol": "Ticker symbol chosen by the creator of the token"
        }
      },
      "isApprovedForAll(address,address)": {
        "details": "Denotes whether operator is approved to transfer account's tokens",
        "params": {
          "_account": "Wallet address holding tokens",
          "_operator": "Wallet address which is/isn't approved to transfer _account's tokens"
        },
        "returns": {
          "_0": "Boolean value indicating approval status"
        }
      },
      "owner()": {
        "details": "Returns the address of the current owner."
      },
      "payoutPlatformFees(address)": {
        "details": "Pays out platform fees owed to owner (might opt to call this daily)",
        "params": {
          "_owner": "Owner of the smart contract"
        }
      },
      "renounceOwnership()": {
        "details": "Leaves the contract without owner. It will not be possible to call `onlyOwner` functions anymore. Can only be called by the current owner. NOTE: Renouncing ownership will leave the contract without an owner, thereby removing any functionality that is only available to the owner."
      },
      "safeBatchTransferFrom(address,address,uint256[],uint256[],bytes)": {
        "details": "Transfers a batch of tokens",
        "params": {
          "_amounts": "Array of quantities of token to be transferred",
          "_data": "Data",
          "_from": "Address token is being transferred from",
          "_ids": "Array of IDs of tokens being transferred",
          "_to": "Address token is being transferred to"
        }
      },
      "safeTransferFrom(address,address,uint256,uint256,bytes)": {
        "details": "Transfers a token",
        "params": {
          "_amount": "Quantity of token to be transferred",
          "_data": "Data",
          "_from": "Address token is being transferred from",
          "_id": "ID of token being transferred",
          "_to": "Address token is being transferred to"
        }
      },
      "sellCreatorToken(uint256,uint256,address)": {
        "details": "Allows user to sell a given CreatorToken back to the platform",
        "params": {
          "_amount": "Quantity of the token being transacted",
          "_seller": "Wallet address of user selling the token",
          "_tokenId": "ID of the token being transacted"
        }
      },
      "setApprovalForAll(address,bool)": {
        "details": "Gives operator permission to transfer caller's tokens",
        "params": {
          "_approved": "Boolean value indicating whether operator is approved",
          "_operator": "Wallet address being granted permission"
        }
      },
      "supportsInterface(bytes4)": {
        "details": "See {IERC165-supportsInterface}."
      },
      "transferOwnership(address)": {
        "details": "Transfers ownership of the contract to a new account (`newOwner`). Can only be called by the current owner."
      },
      "uri(uint256)": {
        "details": "See {IERC1155MetadataURI-uri}. This implementation returns the same URI for *all* token types. It relies on the token type ID substitution mechanism https://eips.ethereum.org/EIPS/eip-1155#metadata[defined in the EIP]. Clients calling this function must replace the `\\{id\\}` substring with the actual token type ID."
      },
      "withdraw(address)": {
        "details": "Ownable function allowing for withdrawal",
        "params": {
          "_owner": "Owner of the smart contract"
        }
      }
    },
    "title": "Implements high-level buy and sell functions (which users invoke when transacting)",
    "version": 1
  },
